  array('id' => '44','name' => 'A4M Las Vegas Convention','date' => '12/11/2014','description' => 'CEA staffed this amazing Las Vegas trade show model at a Las Vegas convention this past week. She assisted with crowd gathering, lead generation, and product demos! Thanks Tatiana! www.ceastaffing. ','location' => 'Las Vegas, NV','featuredpic' => 'http://ceastaffing.com/uploads/pastevents/44/Las_Vegas_Trade_Show_Model_Las_Vegas_Event_Model_Las_Vegas_promotional_model_www.ceastaffing.com_233.jpg','pics' => 'http://ceastaffing.com/uploads/pastevents/44/Las_Vegas_Trade_Show_Model_Las_Vegas_Event_Model_Las_Vegas_promotional_model_www.ceastaffing.com_233.jpg,http://ceastaffing.com/uploads/pastevents/44/Las_Vegas_Trade_Show_Model_Las_Vegas_Event_Model_Las_Vegas_promotional_model_www.ceastaffing.com.jpg,http://ceastaffing.com/uploads/pastevents/44/Las_Vegas_Trade_Show_Model_Las_Vegas_Event_Model_Las_Vegas_promotional_model_www.ceastaffing.com_233.jpg','tempid' => '0'),
