  array('id' => '84','name' => 'PLMA Chicago','date' => '11/16/2015','description' => 'Another new client for CEA, woo hoo! We received a request for a Bilingual Trade Show Model in Chicago who could assist with manning our clients booth while they attended big meetings at this years PLMA show at the Rosemont Convention Center. They needed someone intelligent, extremely engaging, well spoken, and reliable. So we provided them with exactly that. Check out one of our favorite Chicago Trade Show Models, Karen, in the pics below. She has it all and we are always so happy to work with her. Our client was also a big fan of hers. She helped them tremendously and would definitely work with her again, as well as us! Woo hoo! ','location' => 'Chicago, IL','featuredpic' => NULL,'pics' => 'http://ceastaffing.com/uploads/pastevents/84/Chicago_Bilingual_trade_show_model_brand_ambassador_Chicago_experiential_marketing_nationwide_staffing_www.ceastaffing.com.jpg','tempid' => '0'),
